import React from "react";
import { geoMercator,geoPath } from 'd3';
const projection = geoMercator()
const path = geoPath(projection)
export const Marks = ({data}) => (
  <g className="marks">
    {
      data.features.map(feature => (
       <path fill='none' stroke d={path(feature)} />
      ))
    }
  </g>
);
